        class:'w3-bar-item w3-button w3-padding-large'
    },
    {
        name:'Delete Product',
        url:'/delete',
        class:'w3-bar-item w3-button w3-padding-large'
    },
     ];
  export   const routes = [
        {
          path: "/",
          exact: true,
          main: () =>  <h2>Home</h2>
        },
        {
          path: "/add",
          main: () => <AddProducts/>
        },
        {
          path: "/delete",
          main: () =><DeleteProducts/>
        }
      ];
